import React, { useState,useEffect } from "react";
import axios from "axios";

const GastoList = () => {
    const [gastos, setGastos] = useState([]);

    useEffect(() => {
        axios.get("http://localhost:8080/api/gasto").then(
            response =>{
                setGastos(response.data);
            }
        ).catch(
            error =>{
                console.error('Error fetching bills: ', error);
            }
        )
    }, []);
    return(
        <div>
            <p>GASTOS</p>
            <ul>
                {
                    gastos.length > 0 ? (
                        gastos.map(gasto => (
                            <li key = {gasto.id}>
                                <strong>{gasto.concepto}</strong>: {gasto.monto} {gasto.fechaRegistro}
                            </li>
                        ))
                    ) : (
                        <p>SIN REGISTROS DE GASTOS</p>
                    )
                }
            </ul>
        </div>
    )
}
export default GastoList;
